  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0108153 includes discrete
  sample and profile data collected from NOAA Ship RONALD H. BROWN in the South Atlantic
  Ocean, South Pacific Ocean and Southern Oceans (> 60 degrees South) from 2005-01-11
  to 2005-02-24 and retrieved during cruise CLIVAR_A16S_2005. These data include AIR
  TEMPERATURE, AIR-SEA DIFFERENCE - PARTIAL PRESSURE (OR FUGACITY) OF CARBON DIOXIDE,
  BAROMETRIC PRESSURE, CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-113 (CFC-113),
  CHLOROFLUOROCARBON-12 (CFC-12), Carbon tetrachloride (CCL4), Chromophoric Dissolved
  Organic Matter (CDOM), DELTA CARBON-13, DELTA CARBON-14, DELTA HELIUM-3, DISSOLVED
  INORGANIC CARBON (DIC), DISSOLVED ORGANIC CARBON, DISSOLVED OXYGEN, FLUORESCENCE,
  HELIUM, HYDROSTATIC PRESSURE, NEON, NITRATE, NITRITE, Partial pressure (or fugacity)
  of carbon dioxide - atmosphere, Partial pressure (or fugacity) of carbon dioxide
  - water, SALINITY, SEA SURFACE TEMPERATURE, TOTAL ALKALINITY (TA), Tritium (Hydrogen
  isotope), WATER TEMPERATURE, WIND DIRECTION, WIND SPEED, pH, phosphate and silicate.
  The instruments used to collect these data include Alkalinity titrator, Barometric
  pressure sensor, CTD, Carbon dioxide (CO2) gas analyzer, Coulometer for DIC measurement,
  Flask with closed headspace for discrete carbon dioxide (CO2) measurement, bottle,
  spectrophotometer and thermosalinographs.nnThese data were collected by Frank J.
  Millero of Rosenstiel School of Marine and Atmospheric Science, Rik Wanninkhof of
  US DOC; NOAA; OAR; Atlantic Oceanographic and Meteorological Laboratory and Richard
  A. Feely of US DOC; NOAA; OAR; Pacific Marine Environmental Laboratory as part of
  the CLIVAR_A16S_2005 data set.nnThe International CLIVAR Global Ocean Carbon and
  Repeat Hydrography Program carries out a systematic and global re-occupation of
  select WOCE/JGOFS hydrographic sections to quantify changes in storage and transport
  of heat, fresh water, carbon dioxide (CO2), and related parameters.\",\n\t\"owner_org\":
